import Posts from "../../components/posts/Posts";
import Share from "../../components/share/Share";
import React, { useEffect } from "react";
import { useHistory } from "react-router-dom";
import "./home.scss";

const Home = () => {
  const history = useHistory();

  useEffect(() => {
    const token = localStorage.getItem("token"); // Gantikan dengan cara Anda menyimpan token di Local Storage atau State Management
    if (!token) {
      // Jika token tidak ada, arahkan ke halaman login
      history.push("/login");
    }
  }, []);

  return (
    <div className="home">
      <Share />
      <Posts />
    </div>
  );
};

export default Home;
